import React from 'react';

function Newtweet () {
    return (
        <div className="newTweet">
            <div className="tweetTitle">
                <div>Title</div>
                <input></input>
            </div>
            <div className="tweetText">
                <div>Text</div>
                <input></input>
            </div>
            <button>Post a new Tweet</button>
        </div>
    );
}

export default Newtweet;
